        super();
        this.state = {
            robots: robot,
            searchField: ''
        }
    }

    onSearchChange(event) {
        console.log(event.target.value);
    }

    render() {
        return (
            <div className='tc'>
                <h1>RoboFriends</h1>
                <SearchBox serachChange={this.onSearchChange}/>
                <SearchBox searchChange={this.onSearchChange}/>
                <CardList robots={ this.state.robots } />
            </div>
        );
    }
}

export default App
